import Vue from 'vue'
import VueRouter from 'vue-router'


Vue.use(VueRouter);

const routes =[
    {
        path:'/',
        name:'Mine',
        component:() => import('../views/Mine.vue')
    },
    {
        path:'/user',
        name:'User',
        component:() => import('../views/User.vue')
    }
]


const router = new VueRouter({
    mode:'history',
    routes
})

export default router
